import React from "react";
import Head from "next/head";
import AppLayout from "../components/AppLayout";

function profile() {
  return (
    <>
      <Head>
        <title>NodeBird</title>
      </Head>
      <AppLayout>
        <div>내 프로필</div>
      </AppLayout>
    </>
  );
}

export default profile;
